import React, { useState } from "react";
import { BrowserRouter as Router, Routes, Route, Link, useLocation } from "react-router-dom";
import HomePage from "./pages/HomePage";
import AboutPage from "./pages/AboutPage";
import WorkPage from "./pages/WorkPage";
import PortfolioPage from "./pages/PortfolioPage";
import ContactPage from "./pages/ContactPage";
import InteractionDesignCase from "./pages/InteractionDesignCase";
import EventManagementCaseStudy from "./pages/EventManagementCaseStudy";
import STQM from "./pages/STQM";

import ParticlesBackground from "./components/ParticlesBackground";

// Responsive device hook
function useIsMobile(breakpoint = 600) {
  const [isMobile, setIsMobile] = React.useState(window.innerWidth < breakpoint);
  React.useEffect(() => {
    function handleResize() { setIsMobile(window.innerWidth < breakpoint); }
    window.addEventListener("resize", handleResize);
    return () => window.removeEventListener("resize", handleResize);
  }, [breakpoint]);
  return isMobile;
}

// Mobile navbar overlay (ubah background jadi gelap supaya match)
function MobileNavMenu({ navs, location, open, setOpen }) {
  return (
    open && (
      <div style={{
        position: "fixed",
        top: 0, right: 0,
        width: "70vw",
        maxWidth: 350,
        height: "100vh",
        background: "#0d1117",          // ← gelap, hilangkan putih
        boxShadow: "-4px 0 24px rgba(0,0,0,0.6)",
        zIndex: 999,
        paddingTop: 60,
        paddingBottom: 30,
        display: "flex",
        flexDirection: "column",
        alignItems: "flex-end"
      }}>
        <button
          onClick={() => setOpen(false)}
          style={{
            background: "none",
            border: "none",
            color: "#7B9ACC",
            fontSize: 28,
            fontWeight: 900,
            marginRight: 24,
            marginTop: -50,
            marginBottom: 30,
            cursor: "pointer"
          }}>×</button>
        {navs.map(({ to, label }) => (
          <Link
            key={to}
            to={to}
            onClick={() => setOpen(false)}
            style={{
              width: "100%",
              textAlign: "right",
              color: location.pathname === to ? "#a5d6ff" : "#c9d1d9",
              textDecoration: "none",
              borderRadius: 0,
              background: location.pathname === to ? "rgba(123, 154, 204, 0.15)" : "none",
              padding: "16px 5vw",
              marginBottom: 4,
              fontWeight: 800,
              fontSize: 17,
              opacity: location.pathname === to ? 1 : 0.9
            }}
          >{label}</Link>
        ))}
      </div>
    )
  );
}

// Navbar – DI SINI KITA HAPUS BENTUK PUTIH ROUNDED
function Navbar() {
  const location = useLocation();
  const isMobile = useIsMobile();
  const [showMenu, setShowMenu] = useState(false);
  const navs = [
    { to: "/", label: "Home" },
    { to: "/about", label: "About" },
    { to: "/work", label: "Work" },
    { to: "/portfolio", label: "Projects" },
    { to: "/contact", label: "Contact" }
  ];

  return (
    <>
      <nav style={{
        width: "100vw",
        background: isMobile ? "#0d1117" : "rgba(13, 17, 23, 0.65)",  // transparan gelap + blur
        backdropFilter: isMobile ? "none" : "blur(16px)",             // efek blur modern (hilangkan kotak putih)
        boxShadow: isMobile ? "none" : "0 4px 30px rgba(0,0,0,0.35)",
        borderBottom: "1px solid rgba(48, 54, 61, 0.3)",
        padding: isMobile ? "12px 0" : "18px 0",
        display: "flex",
        justifyContent: isMobile ? "flex-end" : "center",
        alignItems: "center",
        position: "fixed",          // fixed biar selalu stay di atas
        top: 0,
        left: 0,
        zIndex: 1000,
        gap: isMobile ? 0 : 48,
        fontWeight: 700,
        fontSize: isMobile ? 15 : 18,
      }}>
        {/* Desktop links – tanpa rounded box, lebih clean */}
        {!isMobile && (
          <>
            {navs.map(({ to, label }) => (
              <Link
                key={to}
                to={to}
                style={{
                  color: location.pathname === to ? "#a5d6ff" : "#c9d1d9",
                  textDecoration: "none",
                  padding: "10px 18px",
                  borderRadius: 6,
                  background: "transparent",                    // hilangkan background active
                  fontWeight: location.pathname === to ? 900 : 700,
                  transition: "color 0.2s ease",
                }}
              >
                {label}
              </Link>
            ))}
          </>
        )}

        {/* Mobile: hamburger menu */}
        {isMobile && (
          <button
            onClick={() => setShowMenu(v => !v)}
            style={{
              background: "none",
              border: "none",
              fontSize: 32,
              fontWeight: 900,
              color: "#7B9ACC",
              marginRight: 20,
              cursor: "pointer",
              padding: 0,
            }}
            aria-label="Open menu"
          >
            ☰
          </button>
        )}
      </nav>

      {/* Mobile dropdown */}
      <MobileNavMenu navs={navs} location={location} open={isMobile && showMenu} setOpen={setShowMenu} />
    </>
  );
}

// Main App
export default function App() {
  return (
    <Router>
      <ParticlesBackground />

      <div style={{
        position: "relative",
        zIndex: 1,
        minHeight: "100vh",
        background: "rgba(10, 14, 23, 0.5)",   // overlay gelap ringan biar teks readable
        backdropFilter: "blur(6px)",           // optional: blur keseluruhan konten
        paddingTop: "80px",                    // space untuk navbar fixed
      }}>
        <Navbar />
        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/about" element={<AboutPage />} />
          <Route path="/work" element={<WorkPage />} />
          <Route path="/portfolio" element={<PortfolioPage />} />
          <Route path="/contact" element={<ContactPage />} />
          <Route path="/interaction-design-case" element={<InteractionDesignCase />} />
          <Route path="/event-management-case-study" element={<EventManagementCaseStudy />} />
          <Route path="/stqm-case-study" element={<STQM />} />
        </Routes>
      </div>
    </Router>
  );
}
